class Rect:  def __init__(self, w, h):     self.w = w     self.h = h  def area(self):     return self.w * self.h  def print(self):     print(self.w, self.h)  def isSquare(self):     return self.w == self.h  def __eq__(self, r):     print('in __eq__')     return (self.w == r.w) and \         (self.h == r.h)def test():  r = Rect(3,5)  r.print() # ==> print(r)  print(r.area())  # ==> area(r)  print(r.isSquare())  r2 = Rect(3,5)  print(r2 == r)  print('--------')  r3 = Rect(5,4)  print(r == r3)test()